import React, {useEffect} from 'react';
import axios from "axios";

const Category = () => {
    useEffect(()=>{
        axios('https://www.themealdb.com/api/json/v1/1/filter.php?c=chicken')
            .then({})
    },[]);
    return (
        <div>
            Category
        </div>
    );
};

export default Category;
